import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import MainPage from './MainPage';
import LoginPage from './LoginPage'; // Закладаємо, що ви створите цей файл
import RegisterPage from './RegisterPage'; // Закладаємо, що ви створите цей файл
import ProfilePage from './ProfilePage'; // Закладаємо, що ви створите цей файл
import DriverMapPage from './DriverMapPage'; // Закладаємо, що ви створите цей файл

function App() {
  return (
    <Router>
      <div className="App">
        <Switch>
          <Route path="/" exact component={MainPage} />
          <Route path="/login" component={LoginPage} />
          <Route path="/register" component={RegisterPage} />
          <Route path="/profile" component={ProfilePage} />
          <Route path="/map" component={DriverMapPage} />
        </Switch>
      </div>
    </Router>
  );
}

export default App;
